import React from "react";

const Header = () => {
  const name = 'Nick';
  return (
    <>
      <h1>Title</h1>
      {name === 'Judy' ? <div>{name}</div> : <div>false</div>}
    </>
  );
}

const App = () => {
  return (
    <>
      <Header />
    </>
  );
}

export default App;
// export { App };
